import { Link } from "react-router-dom";

export const Home = (props) => {

    return (
        <div>
            <h1>This is the home page</h1>
            <Link to="PantryPage">Click to view our PantryPage page</Link>
            <Link to="AdvancedPage">Click to view our AdvancedPage page</Link>
            </div>
    )
}
